INSERT INTO `books` (`Id`, `ISBN`, `BookName`, `Genre`, `Description`, `BookAuthorId`, `BookTook`, `BookReturned`, `Image`) VALUES
('21470f8f-08d3-4778-87be-25cac99d1bda', '9543245683456', 'Зов Ктулху', 'Хоррор', 'В вещах покойного деда бостонский антрополог обнаруживает странный глиняный барельеф, который толкает его на расследование причин гибели родственника. Главный герой узнает, что у божества Ктулху, изображенного на артефакте, есть последователи: некие сектанты во время оргий приносят в жертву людей. А позже находятся записки моряка, который своими глазами видел загадочного персонажа, а затем погиб при странных обстоятельствах. Череда необъяснимых смертей заставляет главного героя задуматься и о своей безопасности...\nНаписанный в начале прошлого века рассказ «Зов Ктулху» тогда публиковался в бульварной прессе и был замечен лишь немногими критиками. Но после смерти автора — Говарда Лавкрафта — все изменилось донельзя.', '68672f8c-9c6b-459a-8985-5abf2605c727', NULL, NULL, ),
('34e52780-da30-4966-9951-428af13228a3', '9785171141769', 'Паўлінка', 'Комедия', 'Камедыя завершана ў 1912 г. Упершыню выйшла асобным выданнем у 1913 г. у Пецярбургу ў выдавецтве \"Загляне сонца і ў наша аконца\". У цэнтры падзей - разумная, дасціпная, вострая на язык Паўлінка. Яна вольналюбівая, здольная пастаяць за сябе, за сваё каханне, ідзе ў жыццё самастойнай дарогай.\n\nПакахаўшы настаўніка Якіма Сароку, вобраз якога ўвасабляе новыя павевы ў жыцці вёскі, яна цягнецца і да святла тых новых ідэй, якія ён нясе. Але на шляху закаханых становяцца патрыярхальныя, кансерватыўныя сілы. Паўлінка знаходзіць у сабе мужнасць супрацьстаяць патрыярхальшчыне і фанабэрыі. Вобраз Паўлінкі ўвасабляў перадавыя сілы Беларусі, абуджаў народ да новага жыцця. Фінал п\'есы гучыць драматычна - Якіма арыштавалі па даносу бацькі Паўлінкі. Так звычайная сямейна-бытавая калізія перарастае ў глыбокі сацыяльна-палітычны канфлікт, а п\'еса з бытавой камедыі - у сацыяльна-праблемную.', '7db056ab-9abf-4985-b917-5d7f06997e33', NULL, NULL, );
INSERT INTO `books` (`Id`, `ISBN`, `BookName`, `Genre`, `Description`, `BookAuthorId`, `BookTook`, `BookReturned`, `Image`) VALUES
('516d6e52-b6ac-40a6-9a57-fdabe30a7afa', '9785041035860', 'На Марс!', 'Фантастика', 'Могут ли мечты стать реальностью? Или мир грез так и останется иллюзорным? Всю жизнь Ивану твердили, что нужно довольствоваться тем, что имеешь. Но Иван всегда четко знал, что хочет получить от жизни. Его не могли остановить неудачи. Он учился на своих ошибках… Пока в один момент в его судьбу не вмешалась сила, которая имеет власть не только над Иваном, но и над всем его миром. Стоит Ване добиться успеха, стать миллиардером, запустить ракету на Марс, чтобы осуществить мечту колонизировать Красную планету, как все оборачивается пеплом. Главный герой сходит с ума? Или кто-то чужой пишет его историю? А может, кошмар начался в далеком прошлом, когда маленький мальчик увидел то, чего видеть не должен? Или все намного проще и сам автор этой книги переступил черту, отделяющую гения от безумца?', '49b5551f-bc29-48b0-bd79-66118e3a083f', NULL, NULL, );
INSERT INTO `books` (`Id`, `ISBN`, `BookName`, `Genre`, `Description`, `BookAuthorId`, `BookTook`, `BookReturned`, `Image`) VALUES
('6cab8475-3a51-4708-b1b8-e5d455d8366e', '9789851552883', 'Новая зямля', 'Поэзия', 'Якуб Колас (1882–1956) — славуты беларускі пісьменнік. Ягоную паэму «Новая зямля» называюць энцыклапедыяй народнага жыцця беларусаў. Першыя раздзелы былі напісаны ў 1911 годзе, калі Колас сядзеў у мінскім астрозе і сумаваў па родных мясцінах. А завершаны твор 5 студзеня 1923 года ў Мінску.\n\n\nДля каго «Новая зямля» — для дарослых ці для дзяцей? Напэўна, для кожнага тут знойдзецца тое, што яму цікава. У паэме ёсць і лірычныя адступленні, і апісанні народных святаў, і гарэзлівыя сцэны з «Дарэктара» або «Зімы ў Парэччы», і неверагодна глыбокая сцэна смерці Міхала... А першы радок твора ведае, бадай, кожны беларус: «Мой родны кут, як ты мне мілы!..»', 'fff8ba0f-b2ec-402b-88d7-b14c114a94a4', NULL, NULL, ),
('97a26e6d-236e-4223-9021-43370040dc74', '9780449234082', 'Крёстный отец', 'Криминальный триллер, Мистерия', 'Клан Корлеоне - могущественнейший во всей Америке. Для общества они торговцы маслом, а на деле сфера их влияния куда больше. Единственное, чем не хочет марать руки дон Корлеоне, - наркотики. Его отказ сильно задевает остальные семьи. Такое стареющему дону простить не могут. Начинается длительная вой', '2cd26c06-43f7-43e6-b4fa-654005fc5bcc', NULL, NULL, );
INSERT INTO `books` (`Id`, `ISBN`, `BookName`, `Genre`, `Description`, `BookAuthorId`, `BookTook`, `BookReturned`, `Image`) VALUES
('ad56deec-1d9c-4230-80fe-6495caa2bac5', '9785389101388', 'Гениальность и помешательство', 'Классическая психология', 'Чезаре Ломброзо - выдающийся итальянский психиатр и криминалист, посвятивший жизнь изучению природы безумия и психологии преступника. \"Гениальность и помешательство\" - одна из самых знаменитых и увлекательных его работ, в которой автор прослеживает четкую связь между гениальностью и психическими аномалиями, образующимися под воздействием окружающей среды и общества. Приводя множество исторических и биографических фактов, Ломброзо исследует физиологическое сходство между великими людьми (среди прочих это Аристотель, Руссо, Гофман, Шопенгауэр, Моцарт, Ван Гог, Гоголь, Линней, Ньютон, Гёте) и помешанными, утверждает влияние наследственности и метеорологических явлений на их судьбу и характер.', '8a996ed2-dd37-4ae5-bbee-d1623de50da1', NULL, NULL, );
INSERT INTO `books` (`Id`, `ISBN`, `BookName`, `Genre`, `Description`, `BookAuthorId`, `BookTook`, `BookReturned`, `Image`) VALUES
('b3f4de0e-83e0-4394-b71a-7ee6db97fc13', '9785699997732', 'Серебряные глаза', 'Хоррор', 'Чарли, дочь создателя аниматроников, спустя много лет возвращается в родной город. Вместе с друзьями они решают отправиться в заброшенную пиццерию \"У Фредди Фазбера\", где специально сконструированные животные-талисманы, развлекали посетителей. Что же случилось в пиццерии 17 лет назад? Они хотят найти ответы на мучающие их вопросы. Однако компания друзей и не подозревает, что кошмар может повториться… Если вы - фанат популярной компьютерной игры ФНАФ или просто любите ужасы, тогда эта книга специально для вас!\nДля старшего школьного возраста.', '72556ed1-4df6-4873-b17c-5077d5c435cd', NULL, NULL, );

